import React, { useEffect, useState } from "react";
import axios from "axios";
import { DataGrid } from "@mui/x-data-grid";

const Home = () => {
  const [empleados, setEmpleados] = useState([]);

  useEffect(() => {
    axios
      .get("/prueba")
      .then((res) => {
        const data = res.data;
        setEmpleados(data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <table class="table">
        {empleados.map((empleado) => (
          <div>
      <thead>
        <tr>
        <th scope="col">First</th> 
        <tbody>
          <tr>
            <td>{empleado.name}</td>
          </tr>
        </tbody>
          <th scope="col">Last</th>
          <tbody>
          <tr>
            <td>{empleado.name}</td>
          </tr>
        </tbody>
          <th scope="col">Handle</th>
          <tbody>
          <tr>
            <td>{empleado.name}</td>
          </tr>
        </tbody>
          <th scope="col">Handle</th>
          <tbody>
          <tr>
            <td>{empleado.name}</td>
          </tr>
        </tbody>
        </tr>
      </thead>
      <tbody>
            <tr>

              <td>{empleado.sector}</td>
              <td>{empleado.age}</td>
              <td>{empleado.email}</td>
            </tr>

      </tbody>
      </div>
        ))}
    </table>
    // <div className="main-containe">
    //   <table>
    //     {empleados.map((empleado) => (
    //       <div>
    //        <thead>
    //        <tr>
    //          <th>Nombre de empleado</th>
    //          <th>Sector</th>
    //          <th>Edad</th>
    //          <th>Email</th>
    //          </tr>
    //          </thead>

    //          <tr>
    //          <td> {empleado.name}</td>
    //          <td>{empleado.sector}</td>
    //          <td>{empleado.age}</td>
    //          <td>{empleado.email}</td>
    //          </tr>

    //      </div>
    //     ))}
    //   </table>
    // </div>
  );
};

export default Home;
